sp; &nbsp;&nbsp;</p>\n','','','<iframeiframe>','Medium','<p>&nbsp; &nbsp;&nbsp;</p>\n','Active','1','0','Live','00:01:00',1,'2020-10-09 15:50:25','2020-12-20 07:53:21'),(36,9,10,16,14,'<p>&nbsp;You receive the following formula for a wart solution:<br />\n<br />\nRx&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Lactic acid&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;10% w/v<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Salicylic acid&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;10% w/v<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Flexible collodion&nbsp; &nbsp;qs&nbsp; &nbsp; &nbsp;15 mL<br />\n<br />\nSalicylic acid is available as the powder and lactic acid is available as an 85% w/w solution with a specific gravity of 1.21. How many milliliters of lactic acid would be needed to prepare this solution? Round answer to the nearest hundredth. Do not include units.</p>\n','Detail',171,'<p>&nbsp; &nbsp;</p>\n','','','<iframeiframe>','Medium','<p>&nbsp; &nbsp;&nbsp;</p>\n','Active','1','0','Demo','00:01:30',1,'2020-10-09 17:55:45','2020-12-20 07:53:42'),(37,9,8,13,11,'<p>A formula for 1250 tablets contains 6.25 grams (g) of diazepam. How many grams of diazepam should be used in preparing 620 tablets? Round answer to the nearest hundredth. Do not include units.</p>\n','Detail',172,'<video width=\"100%\" height=\"100%\" id=\"pv_PWmypHuq\" oncontextmenu=\"return false;\" controlslist=\"nodownload\" controls=\"\" poster=\"https://media.publit.io/file/DanquahPrepVideos/Chapter1/Chapter-1-question-1.jpg\"   playsinline ></video><script src=\"https://static.publit.io/js/hls.js\"></script><script>if (Hls.isSupported()) {var video = document.getElementById(\"pv_PWmypHuq\");var hls = new Hls();hls.attachMedia(video);hls.on(Hls.Events.MEDIA_ATTACHED, function () {hls.loadSource(\"https://media.publit.io/file/DanquahPrepVideos/Chapter1/Chapter-1-question-1.m3u8\");});}</script>','','','<iframeiframe>','Low','<p>&nbsp;&nbsp;</p>\n','Active','1','0','Live','00:01:00',1,'2020-10-10 13:35:25','2020-12-20 07:53:45'),(38,9,8,13,11,'<p>The dose of a drug is 0.05 mg for each kilogram of a patient&rsquo;s weight. The drug is available as an oral liquid containing 50 mcg/0.1 mL. Calculate the dose of the oral liquid, in milliliters, for a patient who weighs 112 lb. Round to the nearest tenth. Do not include units.</p>\n','Detail',173,'<p>&nbsp; &nbsp;</p>\n','','','<iframeiframe>','Medium','<p>&nbsp; &nbsp;</p>\n','Active','1','0','Demo','00:01:30',1,'2020-10-10 13:35:57','2020-12-20 07:53:47'),(39,9,8,13,11,'<p>An injection contains 2 mg of medication in each milliliter (mL). If a physician prescribes a dose of 0.5 mg to be administered to a hospital patient three times daily, how many milliliters of injection will be required over a 18-day period? Round to the nearest hundredth. Do not include units.</p>\n','Detail',174,'<p>&nbsp; &nbsp;</p>\n','','','<iframeiframe>','Medium','<p>&nbsp; &nbsp;</p>\n','Active','1','0','Live','00:01:30',1,'2020-10-10 13:36:28','2020-12-20 07:53:50'),(40,9,8,13,11,'<p>If an intravenous fluid is adjusted to deliver 35 mg of medication to a patient per hour, how many milligrams of medication are delivered per half minute? Round answer to the nearest thousandth. Do not include units.</p>\n','Detail',175,'<p>&nbsp; &nbsp;</p>\n','','','<iframeiframe>','Low','<p>&nbsp; &nbsp;&nbsp;</p>\n','Active','1','0','Live','00:01:00',1,'2020-10-10 13:37:00','2020-12-20 07:53:53'),(41,9,8,13,11,'<p>The blood serum concentration of the antibacterial drug ciprofloxacin increases proportionately with the dose of drug administered. If a 250-mg dose of the drug results in a serum concentration of 1.2 micrograms of drug per milliliter of serum, how many micrograms of drug would be expected per milliliter of serum following a dose of 630 mg of drug? Round to the nearest tenth. Do not include units.</p>\n','Detail',176,'<p>&nbsp;&nbsp;</p>\n','','','<iframeiframe>','High','<p>&nbsp;&nbsp;</p>\n','Active','1','0','Live','00:02:00',1,'2020-10-10 13:37:50','2020-12-20 07:53:57'),(42,9,11,19,17,'<p>If 0.5 mL of a mumps virus vaccine contains 5000 units of antigen, how many units would be present in each milliliter if the 0.5 mL of vaccine was diluted to 5.2 mL with water for injection? Round answer to the nearest whole number. Do not include units.</p>\n','Detail',177,'<p>&nbsp; &nbsp;</p>\n','','','<iframeiframe>','Medium','<p>&nbsp; &nbsp;</p>\n','Active','1','0','Demo','00:01:30',1,'2020-10-10 13:38:39','2020-12-20 07:54:04'),(43,9,11,19,17,'<p>If 1 milliliter contains 10000 units of antigen, how many units will be in each milliliter if 1 mL was diluted to 60 mL? Round answer to the nearest whole number. Do not include units.</p>\n','Detail',178,'<p>&nbsp; &nbsp;</p>\n','','','<iframeiframe>','Low','<p>&nbsp; &nbsp;&nbsp;</p>\n','Active','1','0','Demo','00:01:00',1,'2020-10-10 13:39:13','2020-12-20 07:54:06'),(44,9,11,19,17,'<p>A cough syrup has 4 grams of active ingredient per liter. How many milligrams are contained in 3 tablespoon dose of the elixir? Round answer to the nearest tenth. Do not include units.</p>\n','Detail',179,'<p>&nbsp; &nbsp;</p>\n','','','<iframeiframe>','Low','<p>&nbsp; &nbsp;&nbsp;</p>\n','Active','1','0','Live','00:01:00',1,'2020-10-10 13:40:31','2020-12-20 07:54:08'),(45,9,11,19,17,'<p>If a 90 mL bottle contains 0.5 g of vancomycin, how many milliliters do you need for 20 mg? Round answer to the nearest tenth. Do not include units.</p>\n','Detail',180,'<p>&nbsp; &nbsp;</p>\n','','','<iframeiframe>','Low','<p>&nbsp; &nbsp;</p>\n','Active','1','0','Live','00:01:00',1,'2020-10-10 13:40:54','2020-12-20 07:54:11'),(46,9,11,19,17,'<p>How many milliliters of an injection containing 0.25 mg of drug in each milliliter should be administered to provide a dose of 65 mcg? Round answer to the nearest hundredth. Do not include units.</p>\n','Detail',181,'<p>&nbsp;&nbsp;</p>\n','','','<iframeiframe>','Medium','<p>&nbsp; &nbsp;</p>\n','Active','1','0','Live','00:01:30',1,'2020-10-10 13:41:15','2020-12-20 07:54:14'),(47,9,15,27,25,'<p>Add 0.009 kg, 1114 mg, 6.85 g, and 566436 &mu;g, and express the answer in grams. Round answer to the nearest thousandth. Do not include units.</p>\n','Detail',182,'<p>&nbsp; &nbsp;</p>\n','','','<iframeiframe>','Low','<p>&nbsp; &nbsp;</p>\n','Active','1','0','Live','00:01:00',1,'2020-10-10 13:41:49','2020-12-20 07:54:18'),(48,9,11,19,17,'<p>A low-strength aspirin tablet contains 81 mg of aspirin per tablet. How many tablets may a manufacturer prepare from 0.62 kg of aspirin? Round answer to the nearest whole number. Do not include units.</p>\n','Detail',183,'<p>&nbsp; &nbsp;&nbsp;</p>\n','','','<iframeiframe>','Medium','<p>&nbsp; &nbsp;&nbsp;</p>\n','Active','1','0','Live','00:01:30',1,'2020-10-10 13:42:17','2020-12-20 07:54:21'),(49,9,11,19,17,'<p>One-half liter of solution for intravenous infusion contains 9 g of drug. How many milliliters of the solution would contain 2 mg of drug? Round answer to the nearest thousandth. Do not include units.</p>\n','Detail',184,'<p>&nbsp; &nbsp;</p>\n','','','<iframeiframe>','High','<p>&nbsp; &nbsp;&nbsp;</p>\n','Active','1','0','Live','00:02:00',1,'2020-10-10 13:42:40','2020-12-20 07:54:23'),(50,9,11,19,17,'<p>An injection contains 50 mcg/0.5 mL of drug. How many &mu;L of the injection should be administered to deliver 0.06 mg of drug? Round to the nearest whole number. Do not include units.</p>\n','Detail',185,'<p>&nbsp;&nbsp;</p>\n','','','<iframeiframe>','High','<p>&nbsp; &nbsp;&nbsp;</p>\n','Active','1','0','Live','00:02:00',1,'2020-10-10 13:43:11','2020-12-20 07:54:26'),(51,9,11,19,17,'<p>&nbsp;An inhalation aerosol contains 225 mg of metaproterenol sulfate, which is sufficient for 300 inhalations. How many micrograms of metaproterenol sulfate would be contained in 2 inhalation? Round to the nearest whole number. Do not include units.</p>\n','Detail',186,'<p>&nbsp; &nbsp;</p>\n','','','<iframeiframe>','Medium','<p>&nbsp; &nbsp;</p>\n','Active','1','0','Live','00:01:30',1,'2020-10-10 13:44:02','2020-12-20 07:54:29'),(52,9,15,27,25,'<p>What is 2+7?</p>\n','Detail',187,'<video width=\"100%\" height=\"100%\" id=\"pv_wGW7ifc7\" oncontextmenu=\"return false;\" controlslist=\"nodownload\" controls=\"\" poster=\"https://media.publit.io/file/DanquahPrepVideos/Chapter1/Chapter-1-question-5.jpg\"   playsinline ></video><script src=\"https://static.publit.io/js/hls.js\"></script><script>if (Hls.isSupported()) {var video = document.getElementById(\"pv_wGW7ifc7\");var hls = new Hls();hls.attachMedia(video);hls.on(Hls.Events.MEDIA_ATTACHED, function () {hls.loadSource(\"https://media.publit.io/file/DanquahPrepVideos/Chapter1/Chapter-1-question-5.m3u8\");});}</script>','','','<iframeiframe>','Low','<p>&nbsp; &nbsp;</p>\n','Active','1','0','Live','00:01:00',1,'2020-10-10 14:09:53','2020-12-20 07:54:32'),(53,9,8,13,11,'<p>A formula for 1250 tablets contains 6.25 grams (g) of diazepam. How many grams of diazepam should be used in preparing 620 tablets? Round answer to the nearest hundredth. Do not include units.</p>\n','Detail',188,'\n','','','<iframeiframe>','Low','<p>&nbsp; &nbsp; &nbsp;&nbsp;</p>\n','Active','1','0','Demo','00:01:00',1,'2020-10-12 15:11:44','2020-12-20 07:54:34'),(54,9,18,30,28,'<p>You need to prepare one gallon of Pluronic Gel 20% to make PLO. This consists of Pluronic F-127, NF 20% w/v and potassium sorbate, NF 0.2% w/v in water. How many grams of Pluronic F-127 will you need? Round to the nearest tenth. Do not include units.</p>\n','Detail',191,'<p>&nbsp; &nbsp;&nbsp;</p>\n','','','<iframeiframe>','Medium','<p>&nbsp; &nbsp;&nbsp;</p>\n','Active','1','0','Demo','00:01:00',1,'2020-10-12 15:17:42','2020-12-20 07:54:37'),(55,9,18,0,27,'<p>You need to prepare one gallon of Pluronic Gel 20% to make PLO. This consists of Pluronic F-127, NF 20% w/v and potassium sorbate, NF 0.2% w/v in water. How many grams of Pluronic F-127 will you need? Round to the nearest tenth.