e src=\"https://media.publit.io/file/NAPLEXCalculationsQuestionBank/FlowRateCalculations/Chapter-15-Question-13-weboptimized.html?player=RxCalc\" scrolling=\"no\" style=\"border: 0; top: 0; left: 0; width: 100%; height: 100%; position: absolute; overflow:hidden;\" allowfullscreen=\"\"></iframe></figure></div></div>','','','','Low','<p>&nbsp; &nbsp;</p>\r\n','Active','0','0','Live','00:01:30',1,'2022-02-13 20:26:21','2022-02-13 20:26:34'),(167,9,21,37,41,'<p>A patient was diagnosed with DVT, the physician ordered 25,000 units of heparin in a 2000 mL bag of 5% dextrose. The rate of infusion was set at 250 units/hour. Calculate the rate of infusion in mL/hour.&nbsp;Round to the nearest whole number. Do not include units.</p>\r\n','Detail',372,'<div><div style=\"left: 0; width: 100%; height: 0; position: relative; padding-bottom: 82.71%;\"><figure style=\"left: 0; width: 100%; height: 0; position: relative; padding-bottom: 82.71%; margin-block-end: 0; margin-block-start: 0; margin-inline-start: 0; margin-inline-end: 0;\" ><iframe src=\"https://media.publit.io/file/NAPLEXCalculationsQuestionBank/FlowRateCalculations/Chapter-15-Question-14-weboptimized.html?player=RxCalc\" scrolling=\"no\" style=\"border: 0; top: 0; left: 0; width: 100%; height: 100%; position: absolute; overflow:hidden;\" allowfullscreen=\"\"></iframe></figure></div></div>\r\n','','','','Low','<p>&nbsp; &nbsp;</p>\r\n','Active','0','0','Live','00:01:30',1,'2022-02-13 20:28:37','2022-02-13 20:28:49'),(168,9,21,37,41,'<p>You decide to add 75 mg of a drug to a 750 mL large volume parenteral fluid to deliver 4 mg of drug per hour. Calculate the rate of flow in mL per hour.&nbsp;Round to the nearest whole number. Do not include units.</p>\r\n','Detail',373,'<div><div style=\"left: 0; width: 100%; height: 0; position: relative; padding-bottom: 82.71%;\"><figure style=\"left: 0; width: 100%; height: 0; position: relative; padding-bottom: 82.71%; margin-block-end: 0; margin-block-start: 0; margin-inline-start: 0; margin-inline-end: 0;\" ><iframe src=\"https://media.publit.io/file/NAPLEXCalculationsQuestionBank/FlowRateCalculations/Chapter-15-Question-15-weboptimized.html?player=RxCalc\" scrolling=\"no\" style=\"border: 0; top: 0; left: 0; width: 100%; height: 100%; position: absolute; overflow:hidden;\" allowfullscreen=\"\"></iframe></figure></div></div>','','','','Low','<p>&nbsp; &nbsp;</p>\r\n','Active','0','0','Live','00:01:30',1,'2022-02-13 20:31:03','2022-02-13 20:31:15'),(169,9,21,37,43,'<p>Medication Order: Norepinephrine 10 mg in 500 mL NS. Infuse at 6 &micro;g/min. What is the flow rate (gtt/min) if the administration set delivers 30 gtt/mL?&nbsp;Round to the nearest whole number. Do not include units.</p>\r\n','Detail',374,'<div><div style=\"left: 0; width: 100%; height: 0; position: relative; padding-bottom: 82.71%;\"><figure style=\"left: 0; width: 100%; height: 0; position: relative; padding-bottom: 82.71%; margin-block-end: 0; margin-block-start: 0; margin-inline-start: 0; margin-inline-end: 0;\" ><iframe src=\"https://media.publit.io/file/NAPLEXCalculationsQuestionBank/FlowRateCalculations/Chapter-15-Question-16-weboptimized.html?player=RxCalc\" scrolling=\"no\" style=\"border: 0; top: 0; left: 0; width: 100%; height: 100%; position: absolute; overflow:hidden;\" allowfullscreen=\"\"></iframe></figure></div></div>','','','','Medium','<p>&nbsp; &nbsp;</p>\r\n','Active','0','0','Live','00:01:30',1,'2022-02-13 20:33:59','2022-02-13 20:34:12'),(170,9,21,37,46,'<p>A physician orders a 3 g vial of levofloxacin to be added to a 250 mL bag of D<sub>5</sub>W. The administration rate is 100 mL per hour. How many milligrams of levofloxacin will the patient receive per minute? Round to the nearest whole number. Do not include units.</p>\r\n','Detail',375,'<div><div style=\"left: 0; width: 100%; height: 0; position: relative; padding-bottom: 82.71%;\"><figure style=\"left: 0; width: 100%; height: 0; position: relative; padding-bottom: 82.71%; margin-block-end: 0; margin-b