INSERT INTO `tbl_settings` VALUES (1,5,'ACT-student.jpg','<h1><strong>The&nbsp;right&nbsp;ACT&nbsp;preparation&nbsp;</strong></h1>\n\n<h1><strong>for&nbsp;the&nbsp;best&nbsp;result.&nbsp;</strong></h1>\n\n<h1>&nbsp;</h1>\n','Your Success is Our Passion','<p>Thankfully,&nbsp;there&nbsp;haven&#39;t&nbsp;been&nbsp;many&nbsp;changes&nbsp;to&nbsp;the&nbsp;ACT&nbsp;format&nbsp;in&nbsp;the&nbsp;more&nbsp;recent&nbsp;years.&nbsp;The&nbsp;ACT&nbsp;is&nbsp;a&nbsp;standard&nbsp;college&nbsp;entrance&nbsp;exam&nbsp;that&nbsp;is&nbsp;used&nbsp;to&nbsp;evaluate&nbsp;your<br />\nability&nbsp;to&nbsp;take&nbsp;on&nbsp;college-level&nbsp;work.&nbsp;These&nbsp;tests&nbsp;cover&nbsp;math,&nbsp;science,&nbsp;reading,&nbsp;and&nbsp;writing.&nbsp;It&nbsp;also&nbsp;includes&nbsp;an&nbsp;optional&nbsp;essay.&nbsp;We&nbsp;offer&nbsp;over&nbsp;1,400&nbsp;thought-provoking<br />\nACT&nbsp;questions&nbsp;that&nbsp;are&nbsp;intended&nbsp;to&nbsp;replicate&nbsp;the&nbsp;actual&nbsp;ACT&nbsp;exam,&nbsp;so&nbsp;you&nbsp;can&nbsp;feel&nbsp;as&nbsp;confident&nbsp;as&nbsp;possible&nbsp;when&nbsp;it&nbsp;comes&nbsp;time&nbsp;to&nbsp;take&nbsp;the&nbsp;actual&nbsp;exam.&nbsp;Our&nbsp;content<br />\nis&nbsp;supplied&nbsp;and&nbsp;arranged&nbsp;by&nbsp;only&nbsp;the&nbsp;most&nbsp;qualified&nbsp;educators.&nbsp;Our&nbsp;layout&nbsp;allows&nbsp;you&nbsp;to&nbsp;go&nbsp;through&nbsp;each&nbsp;question&nbsp;step-by-step,&nbsp;which&nbsp;fosters&nbsp;critical&nbsp;thinking.&nbsp;If&nbsp;you<br />\nchoose&nbsp;an&nbsp;incorrect&nbsp;answer,&nbsp;detailed&nbsp;explanations&nbsp;and&nbsp;illustrations&nbsp;help&nbsp;you&nbsp;master&nbsp;the&nbsp;content&nbsp;before&nbsp;continuing.&nbsp;Don&#39;t&nbsp;just&nbsp;keep&nbsp;taking&nbsp;the&nbsp;test&nbsp;over&nbsp;and&nbsp;over.&nbsp;To<br />\ntruly&nbsp;improve&nbsp;your&nbsp;scores,&nbsp;you&nbsp;need&nbsp;to&nbsp;take&nbsp;the&nbsp;time&nbsp;to&nbsp;comprehend&nbsp;the&nbsp;information.</p>\n','<p><strong>1400&nbsp;Practice&nbsp;Questions&nbsp;</strong></p>\n\n<p>&rsaquo;&nbsp;&nbsp;&nbsp;Developed&nbsp;and&nbsp;curated&nbsp;by&nbsp;experienced&nbsp;educators</p>\n\n<p><strong>Performance&nbsp;Tracker&nbsp;</strong><br />\n&rsaquo;&nbsp;&nbsp;&nbsp;Easily&nbsp;view&nbsp;your&nbsp;progress&nbsp;at&nbsp;a&nbsp;glance&nbsp;and&nbsp;compare&nbsp;with<br />\nothers.</p>\n\n<p><strong>Test&nbsp;Mode&nbsp;</strong><br />\n&rsaquo;&nbsp;&nbsp;&nbsp;Customize&nbsp;your&nbsp;test&nbsp;taking&nbsp;experience.&nbsp;Select&nbsp;tutor&nbsp;or&nbsp;<br />\ntest&nbsp;mode&nbsp;to&nbsp;suit&nbsp;your&nbsp;preparation&nbsp;goals.</p>\n\n<p><strong>Personalized&nbsp;Practice&nbsp;Exam&nbsp;</strong><br />\n&rsaquo;&nbsp;&nbsp;&nbsp;Focus&nbsp;on&nbsp;pain&nbsp;points.&nbsp;Generate&nbsp;practice&nbsp;questions&nbsp;based<br />\non&nbsp;difficulty&nbsp;level,&nbsp;subject&nbsp;area&nbsp;or&nbsp;questions&nbsp;previously<br />\nmarked&nbsp;for&nbsp;review.</p>\n','This section will provide you with high-quality practice ACT questions, as well as thorough explanations.  Your success is our passion.  Choose your difficulty level and begin practicing today. Prep smart with top-quality ACT practice questions accompanied with detailed explanations. Curate your own practice questions based on difficulty level and personalize your exam preparation.','Active',1,'2018-07-31 05:05:06','2020-10-14 12:56:05'),(2,6,'GRE-student.jpg','<h1><strong>Secure&nbsp;your&nbsp;dream&nbsp;program&nbsp;through&nbsp;our</strong></h1>\n\n<h1><strong>extensive&nbsp;GRE&nbsp;question&nbsp;bank.</strong></h1>\n\n<h1>&nbsp;</h1>\n','Your Success is Our Passion','<p>The&nbsp;GRE&nbsp;(the&nbsp;Graduate&nbsp;Record&nbsp;Examination)&nbsp;is&nbsp;a&nbsp;standardized&nbsp;exam&nbsp;that&nbsp;is&nbsp;often&nbsp;needed&nbsp;for&nbsp;admission&nbsp;to&nbsp;certain&nbsp;graduate&nbsp;programs.&nbsp;Your&nbsp;GRE&nbsp;score&nbsp;is&nbsp;taken&nbsp;into<br />\naccount&nbsp;along&nbsp;with&nbsp;your&nbsp;academic&nbsp;record&nbsp;and&nbsp;supporting&nbsp;materials&nbsp;to&nbsp;determine&nbsp;whether&nbsp;or&nbsp;not&nbsp;you&nbsp;are&nbsp;ready&nbsp;for&nbsp;graduate-level&nbsp;academics.&nbsp;Highly-sought&nbsp;after<br />\ngraduate&nbsp;programs&nbsp;prefers&nbsp;an&nbsp;average&nbsp;GRE&nbsp;score&nbsp;in&nbsp;the&nbsp;90th&nbsp;percentile.&nbsp;At&nbsp;this&nbsp;point&nbsp;in&nbsp;your&nbsp;career,&nbsp;you&nbsp;certainly&nbsp;already&nbsp;have&nbsp;your&nbsp;time&nbsp;filled&nbsp;with&nbsp;school,&nbsp;some&nbsp;type&nbsp;of<br />\npersonal&nbsp;life,&nbsp;and&nbsp;work.&nbsp;Since&nbsp;your&nbsp;time&nbsp;is&nbsp;very&nbsp;limited,&nbsp;the&nbsp;key&nbsp;to&nbsp;a&nbsp;high&nbsp;GRE&nbsp;score&nbsp;is&nbsp;the&nbsp;correct&nbsp;type&nbsp;of&nbsp;preparation&nbsp;and&nbsp;study.&nbsp;The&nbsp;average&nbsp;time&nbsp;it&nbsp;takes&nbsp;to&nbsp;go&nbsp;through<br />\na&nbsp;prep&nbsp;book&nbsp;is&nbsp;around&nbsp;350&nbsp;hours.&nbsp;Instead,&nbsp;use&nbsp;DanquahPrep&#39;s&nbsp;test&nbsp;bank&nbsp;to&nbsp;study&nbsp;as&nbsp;often&nbsp;as&nbsp;you&nbsp;are&nbsp;able,&nbsp;wherever&nbsp;you&nbsp;are&nbsp;able.&nbsp;Get&nbsp;more&nbsp;done&nbsp;in&nbsp;the&nbsp;time&nbsp;you&nbsp;have<br />\navailable.&nbsp;Our&nbsp;GRE&nbsp;database&nbsp;has&nbsp;over&nbsp;1,400&nbsp;questions.&nbsp;We&nbsp;thoroughly&nbsp;review&nbsp;every&nbsp;subject&nbsp;so&nbsp;you&nbsp;don&#39;t&nbsp;have&nbsp;any&nbsp;surprises&nbsp;on&nbsp;test&nbsp;day.&nbsp;Utilize&nbsp;the&nbsp;tracking&nbsp;abilities&nbsp;to<br />\npinpoint&nbsp;your&nbsp;weakness&nbsp;and&nbsp;improve&nbsp;on&nbsp;them,&nbsp;as&nbsp;well&nbsp;as&nbsp;continue&nbsp;to&nbsp;improve&nbsp;on&nbsp;your&nbsp;strengths.&nbsp;You&nbsp;also&nbsp;have&nbsp;access&nbsp;to&nbsp;unlimited&nbsp;practice&nbsp;exams&nbsp;in&nbsp;all&nbsp;the&nbsp;subjects.<br />\nOur&nbsp;test&nbsp;bank&nbsp;makes&nbsp;it&nbsp;convenient&nbsp;for&nbsp;you&nbsp;to&nbsp;study&nbsp;and&nbsp;build&nbsp;your&nbsp;confidence&nbsp;for&nbsp;exam&nbsp;day.</p>\n','<p><strong>1400&nbsp;Practice&nbsp;Questions&nbsp;</strong><br />\n&rsaquo;&nbsp;&nbsp;&nbsp;Developed&nbsp;and&nbsp;curated&nbsp;by&nbsp;experienced&nbsp;educators</p>\n\n<p><strong>Performance&nbsp;Tracker&nbsp;</strong><br />\n&rsaquo;&nbsp;&nbsp;&nbsp;Easily&nbsp;view&nbsp;your&nbsp;progress&nbsp;at&nbsp;a&nbsp;glance&nbsp;and&nbsp;compare&nbsp;with<br />\nothers.</p>\n\n<p><strong>Test&nbsp;Mode&nbsp;</strong><br />\n&rsaquo;&nbsp;&nbsp;&nbsp;Customize&nbsp;your&nbsp;test&nbsp;taking&nbsp;experience.&nbsp;Select&nbsp;tutor&nbsp;or&nbsp;<br />\ntest&nbsp;mode&nbsp;to&nbsp;suit&nbsp;your&nbsp;preparation&nbsp;goals.</p>\n\n<p><strong>Personalized&nbsp;Practice&nbsp;Exam&nbsp;</strong><br />\n&rsaquo;&nbsp;&nbsp;&nbsp;Focus&nbsp;on&nbsp;pain&nbsp;points.&nbsp;Generate&nbsp;practice&nbsp;questions&nbsp;based<br />\non&nbsp;difficulty&nbsp;level,&nbsp;subject&nbsp;area&nbsp;or&nbsp;questions&nbsp;previously<br />\nmarked&nbsp;for&nbsp;review.</p>\n\n<p>&nbsp;</p>\n','Challenge yourself to improve your score by pinpointing your weaknesses and working on them.  Personalize your GRE prep to receive your best possible score now.','Active',1,'2018-07-31 05:08:49','2020-10-14 10:13:51'),(3,7,'SAT-student.jpg','<h1><strong>Our&nbsp;SAT&nbsp;preparation&nbsp;expertise&nbsp;guides</strong></h1>\n\n<h1><strong>you&nbsp;to&nbsp;your&nbsp;success.</strong></h1>\n\n<h1>&nbsp;</h1>\n','Your Success is Our Passion','<p>Most&nbsp;colleges&nbsp;and&nbsp;universities&nbsp;use&nbsp;the&nbsp;SAT&nbsp;entrance&nbsp;exam&nbsp;to&nbsp;determine&nbsp;your&nbsp;readiness&nbsp;to&nbsp;attend&nbsp;their&nbsp;institution.Schools&nbsp;require&nbsp;a&nbsp;minimum&nbsp;score&nbsp;of&nbsp;400.&nbsp;The&nbsp;perfect<br />\nscore&nbsp;is&nbsp;1600,&nbsp;but&nbsp;the&nbsp;average&nbsp;is&nbsp;around&nbsp;1060.&nbsp;The&nbsp;score&nbsp;you&nbsp;need&nbsp;will&nbsp;vary&nbsp;depending&nbsp;on&nbsp;your&nbsp;educational&nbsp;goals&nbsp;and&nbsp;which&nbsp;school&nbsp;you&nbsp;want&nbsp;to&nbsp;attend.Our&nbsp;question<br />\nbank&nbsp;contains&nbsp;over&nbsp;1500&nbsp;of&nbsp;challenging&nbsp;questions&nbsp;that&nbsp;are&nbsp;either&nbsp;at&nbsp;or&nbsp;above&nbsp;the&nbsp;standard&nbsp;SAT&nbsp;difficulty&nbsp;level.&nbsp;We&nbsp;use&nbsp;only&nbsp;the&nbsp;most&nbsp;experienced&nbsp;educators&nbsp;to&nbsp;gather<br />\nour&nbsp;pool&nbsp;of&nbsp;questions&nbsp;and&nbsp;make&nbsp;sure&nbsp;to&nbsp;provide&nbsp;in-depth&nbsp;explanations&nbsp;for&nbsp;each&nbsp;answer&nbsp;so&nbsp;you&nbsp;completely&nbsp;understand&nbsp;the&nbsp;concepts.</p>\n','<p><strong>1400&nbsp;Practice&nbsp;Questions&nbsp;</strong><br />\n&rsaquo;&nbsp;&nbsp;&nbsp;Developed&nbsp;and&nbsp;curated&nbsp;by&nbsp;experienced&nbsp;educators</p>\n\n<p><strong>Performance&nbsp;Tracker&nbsp;</strong><br />\n&rsaquo;&nbsp;&nbsp;&nbsp;Easily&nbsp;view&nbsp;your&nbsp;progress&nbsp;at&nbsp;a&nbsp;glance&nbsp;and&nbsp;compare&nbsp;with<br />\nothers.</p>\n\n<p><strong>Test&nbsp;Mode&nbsp;</strong><br />\n&rsaquo;&nbsp;&nbsp;&nbsp;Customize&nbsp;your&nbsp;test&nbsp;taking&nbsp;experience.&nbsp;Select&nbsp;tutor&nbsp;or&nbsp;<br />\ntest&nbsp;mode&nbsp;to&nbsp;suit&nbsp;your&nbsp;preparation&nbsp;goals.</p>\n\n<p><strong>Personalized&nbsp;Practice&nbsp;Exam&nbsp;</strong><br />\n&rsaquo;&nbsp;&nbsp;&nbsp;Focus&nbsp;on&nbsp;pain&nbsp;points.&nbsp;Generate&nbsp;practice&nbsp;questions&nbsp;based<br />\non&nbsp;difficulty&nbsp;level,&nbsp;subject&nbsp;area&nbsp;or&nbsp;questions&nbsp;previously<br />\nmarked&nbsp;for&nbsp;review.</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n','Challenge yourself to improve your score by pinpointing your weaknesses and working on them.  Personalize your SAT prep to receive your best possible score now.','Active',1,'2018-07-31 05:11:57','2020-10-14 10:20:23'),(4,8,'MCAT-medical-student.jpg','<h1><strong>Succeed&nbsp;in&nbsp;MCAT&nbsp;with&nbsp;confidence&nbsp;thanks</strong></h1>\n\n<h1><strong>to&nbsp;our&nbsp;extensive&nbsp;question&nbsp;banks.</strong></h1>\n\n<h1>&nbsp;</h1>\n','Your Success is Our Passion','<p>The&nbsp;MCAT&nbsp;(the&nbsp;Medical&nbsp;College&nbsp;Admission&nbsp;Test)&nbsp;is&nbsp;the&nbsp;standardized&nbsp;exam&nbsp;that&nbsp;most&nbsp;medical&nbsp;schools&nbsp;use&nbsp;to&nbsp;determine&nbsp;possible&nbsp;applicants&#39;s&nbsp;existing&nbsp;knowledge&nbsp;of&nbsp;and<br />\naptitude&nbsp;for&nbsp;studying&nbsp;medicine.&nbsp;There&nbsp;are&nbsp;several&nbsp;way&nbsp;to&nbsp;study&nbsp;for&nbsp;your&nbsp;MCAT.&nbsp;The&nbsp;best&nbsp;way&nbsp;for&nbsp;you&nbsp;depends&nbsp;on&nbsp;what&nbsp;your&nbsp;goals&nbsp;and&nbsp;and&nbsp;what&nbsp;study&nbsp;style&nbsp;and&nbsp;schedule<br />\nbest&nbsp;suites&nbsp;you.&nbsp;Whether&nbsp;you&nbsp;prefer&nbsp;a&nbsp;traditional&nbsp;classroom&nbsp;or&nbsp;online&nbsp;courses,&nbsp;be&nbsp;sure&nbsp;that&nbsp;your&nbsp;plan&nbsp;includes&nbsp;plenty&nbsp;of&nbsp;opportunities&nbsp;to&nbsp;review&nbsp;and&nbsp;thoroughly&nbsp;learn&nbsp;the<br />\ncontent&nbsp;as&nbsp;well&nbsp;as&nbsp;real-life&nbsp;practice.&nbsp;Our&nbsp;MCAT&nbsp;question&nbsp;banks&nbsp;include&nbsp;over&nbsp;1,600&nbsp;questions.&nbsp;We&nbsp;guarantee&nbsp;that&nbsp;you&nbsp;will&nbsp;cover&nbsp;all&nbsp;information&nbsp;covered&nbsp;on&nbsp;the&nbsp;current<br />\nMCAT&nbsp;exam&nbsp;and&nbsp;will&nbsp;feel&nbsp;confident&nbsp;when&nbsp;it&nbsp;comes&nbsp;times&nbsp;to&nbsp;take&nbsp;the&nbsp;exam.</p>\n','<p><strong>1400&nbsp;Practice&nbsp;Questions&nbsp;</strong><br />\n&rsaquo;&nbsp;&nbsp;&nbsp;Developed&nbsp;and&nbsp;curated&nbsp;by&nbsp;experienced&nbsp;educators</p>\n\n<p><strong>Performance&nbsp;Tracker&nbsp;</strong><br />\n&rsaquo;&nbsp;&nbsp;&nbsp;Easily&nbsp;view&nbsp;your&nbsp;progress&nbsp;at&nbsp;a&nbsp;glance&nbsp;and&nbsp;compare&nbsp;with<br />\nothers.</p>\n\n<p><strong>Test&nbsp;Mode&nbsp;</strong><br />\n&rsaquo;&nbsp;&nbsp;&nbsp;Customize&nbsp;your&nbsp;test&nbsp;taking&nbsp;experience.&nbsp;Select&nbsp;tutor&nbsp;or&nbsp;<br />\ntest&nbsp;mode&nbsp;to&nbsp;suit&nbsp;your&nbsp;preparation&nbsp;goals.</p>\n\n<p><strong>Personalized&nbsp;Practice&nbsp;Exam&nbsp;</strong><br />\n&rsaquo;&nbsp;&nbsp;&nbsp;Focus&nbsp;on&nbsp;pain&nbsp;points.&nbsp;Generate&nbsp;practice&nbsp;questions&nbsp;based<br />\non&nbsp;difficulty&nbsp;level,&nbsp;subject&nbsp;area&nbsp;or&nbsp;questions&nbsp;previously<br />\nmarked&nbsp;for&nbsp;review.</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n','Let&apos;s get you started on your journey to preparing for the medical field.  Start studying for your MCAT now.','Inactive',1,'2018-07-31 05:15:22','2020-10-14 10:20:48'),(5,9,'Pharmaceutical-Calculations-pharmacist.jpg','<h1><strong>Take&nbsp;your&nbsp;Pharmaceutical&nbsp;Calculations</strong></h1>\r\n\r\n<h1><strong>performance&nbsp;to&nbsp;the&nbsp;next&nbsp;level.</strong></h1>\r\n\r\n<p>&nbsp;</p>\r\n','Your Success is Our Passion','<p>Learn&nbsp;how&nbsp;to&nbsp;master&nbsp;pharmaceutical&nbsp;calculations&nbsp;with&nbsp;our&nbsp;Calculations&nbsp;Question&nbsp;Bank.&nbsp;Solve&nbsp;calculations&nbsp;questions&nbsp;correctly&nbsp;and&nbsp;quicker&nbsp;than&nbsp;you&nbsp;ever&nbsp;thought&nbsp;you<br />\r\ncould&nbsp;and&nbsp;skyrocket&nbsp;your&nbsp;performance.</p>\r\n','<p><strong>Up-To-Date&nbsp;Questions</strong></p>\r\n\r\n<p>Over&nbsp;1000&nbsp;NAPLEX&nbsp;type&nbsp;short&nbsp;answer&nbsp;and&nbsp;multiple&nbsp;choice<br />\r\ncalculations&nbsp;questions&nbsp;with&nbsp;answers.</p>\r\n\r\n<p><strong>Personalized&nbsp;Practice</strong></p>\r\n\r\n<p>Designed&nbsp;for&nbsp;self-paced&nbsp;content&nbsp;review&nbsp;and&nbsp;to&nbsp;improve<br />\r\naccuracy.</p>\r\n\r\n<p><strong>Comprehensive</strong></p>\r\n\r\n<p>Covers&nbsp;all&nbsp;pertinent&nbsp;calculations&nbsp;topics&nbsp;described&nbsp;in&nbsp;the<br />\r\nNAPLEX&nbsp;blueprint.</p>\r\n\r\n<p><strong>Time&nbsp;Tracking</strong></p>\r\n\r\n<p>Use&nbsp;different&nbsp;levels&nbsp;of&nbsp;timed&nbsp;test&nbsp;to&nbsp;systematically&nbsp;improve<br />\r\nspeed.</p>\r\n\r\n<p><strong>24/7&nbsp;Access</strong></p>\r\n\r\n<p>Practice&nbsp;on&nbsp;a&nbsp;desktop&nbsp;or&nbsp;mobile&nbsp;phone&nbsp;whenever&nbsp;and<br />\r\nwherever&nbsp;you&nbsp;want.</p>\r\n\r\n<p><strong>Video&nbsp;Solutions</strong></p>\r\n\r\n<p>Gain&nbsp;deeper&nbsp;understanding&nbsp;with&nbsp;our&nbsp;step-by-step&nbsp;video<br />\r\nsolutions&nbsp;including&nbsp;rationale&nbsp;behind&nbsp;solutions.</p>\r\n\r\n<p><strong>Support&nbsp;Included</strong></p>\r\n\r\n<p>Free&nbsp;1&nbsp;hour&nbsp;biweekly&nbsp;question&nbsp;and&nbsp;answer&nbsp;webinar<br />\r\nsessions.</p>\r\n','Master pharmaceutical calculations with high-quality practice questions and  detailed step-by-step video explanations.','Active',1,'2018-07-31 05:20:27','2018-08-20 05:12:18'),(6,10,'PCAT-student.jpg','<h1><strong>Secure&nbsp;the&nbsp;college&nbsp;you&nbsp;want&nbsp;with&nbsp;our&nbsp;PCAT</strong></h1>\n\n<h1><strong>preparation&nbsp;program.</strong></h1>\n\n<p>&nbsp;</p>\n','Your Success is Our Passion','<p>The&nbsp;PCAT&nbsp;is&nbsp;the&nbsp;standard&nbsp;Pharmacy&nbsp;College&nbsp;Admission&nbsp;Test&nbsp;required&nbsp;by&nbsp;most&nbsp;pharmacy&nbsp;educational&nbsp;institutions.&nbsp;This&nbsp;exam&nbsp;is&nbsp;considered&nbsp;a&nbsp;step&nbsp;higher&nbsp;than&nbsp;the&nbsp;SAT<br />\nor&nbsp;the&nbsp;ACT&nbsp;exams.&nbsp;It&nbsp;focuses&nbsp;more&nbsp;on&nbsp;science&nbsp;and&nbsp;math.&nbsp;The&nbsp;scoring&nbsp;on&nbsp;the&nbsp;PCAT&nbsp;ranges&nbsp;from&nbsp;100-300,&nbsp;with&nbsp;the&nbsp;average&nbsp;being&nbsp;around&nbsp;200.&nbsp;Each&nbsp;institution&nbsp;has&nbsp;a<br />\nscore&nbsp;that&nbsp;they&nbsp;deem&nbsp;necessary&nbsp;in&nbsp;order&nbsp;to&nbsp;be&nbsp;accepted&nbsp;at&nbsp;that&nbsp;facility.&nbsp;The&nbsp;exam&nbsp;is&nbsp;generally&nbsp;broken&nbsp;down&nbsp;into&nbsp;a&nbsp;written&nbsp;portion&nbsp;that&nbsp;analyzes&nbsp;your&nbsp;ability&nbsp;to&nbsp;solve<br />\nproblems,&nbsp;a&nbsp;verbal&nbsp;portion,&nbsp;general&nbsp;biology,&nbsp;microbiology,&nbsp;human&nbsp;anatomy&nbsp;and&nbsp;physiology,&nbsp;chemistry,&nbsp;algebra,&nbsp;and&nbsp;calculus.</p>\n','<p><strong>1400&nbsp;Practice&nbsp;Questions&nbsp;</strong><br />\n&rsaquo;&nbsp;&nbsp;&nbsp;Developed&nbsp;and&nbsp;curated&nbsp;by&nbsp;experienced&nbsp;educators</p>\n\n<p><strong>Performance&nbsp;Tracker&nbsp;</strong><br />\n&rsaquo;&nbsp;&nbsp;&nbsp;Easily&nbsp;view&nbsp;your&nbsp;progress&nbsp;at&nbsp;a&nbsp;glance&nbsp;and&nbsp;compare&nbsp;with<br />\nothers.</p>\n\n<p><strong>Test&nbsp;Mode&nbsp;</strong><br />\n&rsaquo;&nbsp;&nbsp;&nbsp;Customize&nbsp;your&nbsp;test&nbsp;taking&nbsp;experience.&nbsp;Select&nbsp;tutor&nbsp;or&nbsp;<br />\ntest&nbsp;mode&nbsp;to&nbsp;suit&nbsp;your&nbsp;preparation&nbsp;goals.</p>\n\n<p><strong>Personalized&nbsp;Practice&nbsp;Exam&nbsp;</strong><br />\n&rsaquo;&nbsp;&nbsp;&nbsp;Focus&nbsp;on&nbsp;pain&nbsp;points.&nbsp;Generate&nbsp;practice&nbsp;questions&nbsp;based<br />\non&nbsp;difficulty&nbsp;level,&nbsp;subject&nbsp;area&nbsp;or&nbsp;questions&nbsp;previously<br />\nmarked&nbsp;for&nbsp;review.</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n','Our test questions will get you confident and ready for your PCAT in no time at all.','Active',1,'2018-07-31 05:22:38','2020-10-14 10:21:24'),(7,11,'PTCB-student.jpg','<h1><strong>Secure&nbsp;your&nbsp;future&nbsp;with&nbsp;PTCE&nbsp;success</strong></h1>\r\n\r\n<h1><strong>through&nbsp;our&nbsp;extensive&nbsp;practice&nbsp;exams.</strong></h1>\r\n\r\n<h1>&nbsp;</h1>\r\n','Your Success is Our Passion','<p>PTCB&nbsp;stands&nbsp;for&nbsp;Pharmacy&nbsp;Technician&nbsp;Certification&nbsp;Board.&nbsp;&nbsp;The&nbsp;Board&nbsp;oversees&nbsp;all&nbsp;pharmacy&nbsp;technician&nbsp;certifications&nbsp;exams&nbsp;(PTCE).&nbsp;&nbsp;This&nbsp;is&nbsp;a&nbsp;standardized&nbsp;exam&nbsp;to<br />\r\ndetermine&nbsp;whether&nbsp;or&nbsp;not&nbsp;a&nbsp;person&nbsp;seems&nbsp;capable&nbsp;of&nbsp;the&nbsp;education&nbsp;needed&nbsp;in&nbsp;order&nbsp;to&nbsp;become&nbsp;a&nbsp;pharmacy&nbsp;technician.&nbsp;The&nbsp;PTCE&nbsp;knowledge&nbsp;is&nbsp;divided&nbsp;into&nbsp;nine&nbsp;topics.<br />\r\nOur&nbsp;expertly&nbsp;gathered&nbsp;practice&nbsp;exams&nbsp;will&nbsp;help&nbsp;you&nbsp;with&nbsp;all&nbsp;the&nbsp;topics.&nbsp;&nbsp;Don&rsquo;t&nbsp;worry;&nbsp;we&nbsp;will&nbsp;make&nbsp;sure&nbsp;you&nbsp;are&nbsp;prepared&nbsp;in&nbsp;all&nbsp;the&nbsp;topics&nbsp;necessary</p>\r\n\r\n<p>&nbsp;</p>\r\n','<p><strong>Highlights&nbsp;of&nbsp;some&nbsp;of&nbsp;the&nbsp;topics&nbsp;covered</strong></p>\r\n\r\n<p><br />\r\n&rsaquo;&nbsp;&nbsp;Calculations&nbsp;<br />\r\n&rsaquo;&nbsp;&nbsp;Pharmacy&nbsp;Law&nbsp;&nbsp;<br />\r\n&rsaquo;&nbsp;&nbsp;Scheduled&nbsp;Drugs&nbsp;<br />\r\n&rsaquo;&nbsp;&nbsp;Top&nbsp;200&nbsp;drugs<br />\r\n&rsaquo;&nbsp;&nbsp;Equipment&nbsp;<br />\r\n&rsaquo;&nbsp;&nbsp;Routes&nbsp;and&nbsp;Formulations&nbsp;<br />\r\n&rsaquo;&nbsp;&nbsp;Parenteral<br />\r\n&rsaquo;&nbsp;&nbsp;Drug&nbsp;Interactions<br />\r\n&rsaquo;&nbsp;&nbsp;Retail&nbsp;math</p>\r\n','Our test questions will get you confident and ready for your PTCE in no time at all.','Active',1,'2018-07-31 05:27:30','2018-08-20 05:33:11'),(8,12,'NCLEX-RN--Nurse.jpg','<h1><strong>Pass&nbsp;the&nbsp;NCLEX&nbsp;RN&nbsp;with&nbsp;confidence</strong></h1>\n\n<h1><strong>with&nbsp;our&nbsp;</strong><strong>world&nbsp;class</strong><strong>&nbsp;preparation.</strong></h1>\n\n<h1>&nbsp;</h1>\n','Your Success is Our Passion','<p>The&nbsp;NCLEX-RN&nbsp;study&nbsp;exams&nbsp;includes&nbsp;over&nbsp;1,250&nbsp;questions&nbsp;expertly&nbsp;collected&nbsp;and&nbsp;organized&nbsp;by&nbsp;practicing&nbsp;nursing&nbsp;and&nbsp;nurse&nbsp;educators.&nbsp;&nbsp;They&nbsp;use&nbsp;their&nbsp;knowledge&nbsp;and<br />\nreal-life&nbsp;clinical&nbsp;practice&nbsp;to&nbsp;make&nbsp;certain&nbsp;you&nbsp;have&nbsp;the&nbsp;most&nbsp;advantageous&nbsp;information&nbsp;available.&nbsp;As&nbsp;you&nbsp;move&nbsp;along&nbsp;through&nbsp;the&nbsp;practice&nbsp;exams,&nbsp;you&nbsp;will&nbsp;receive<br />\nin-depth&nbsp;explanations&nbsp;and&nbsp;countless&nbsp;illustrations&nbsp;and&nbsp;images&nbsp;to&nbsp;ensure&nbsp;you&nbsp;completely&nbsp;understand&nbsp;the&nbsp;content.</p>\n','<p><strong>1400&nbsp;Practice&nbsp;Questions&nbsp;</strong><br />\n&rsaquo;&nbsp;&nbsp;&nbsp;Developed&nbsp;and&nbsp;curated&nbsp;by&nbsp;experienced&nbsp;educators</p>\n\n<p><strong>Performance&nbsp;Tracker&nbsp;</strong><br />\n&rsaquo;&nbsp;&nbsp;&nbsp;Easily&nbsp;view&nbsp;your&nbsp;progress&nbsp;at&nbsp;a&nbsp;glance&nbsp;and&nbsp;compare&nbsp;with<br />\nothers.</p>\n\n<p><strong>Test&nbsp;Mode&nbsp;</strong><br />\n&rsaquo;&nbsp;&nbsp;&nbsp;Customize&nbsp;your&nbsp;test&nbsp;taking&nbsp;experience.&nbsp;Select&nbsp;tutor&nbsp;or&nbsp;<br />\ntest&nbsp;mode&nbsp;to&nbsp;suit&nbsp;your&nbsp;preparation&nbsp;goals.</p>\n\n<p><strong>Personalized&nbsp;Practice&nbsp;Exam&nbsp;</strong><br />\n&rsaquo;&nbsp;&nbsp;&nbsp;Focus&nbsp;on&nbsp;pain&nbsp;points.&nbsp;Generate&nbsp;practice&nbsp;questions&nbsp;based<br />\non&nbsp;difficulty&nbsp;level,&nbsp;subject&nbsp;area&nbsp;or&nbsp;questions&nbsp;previously<br />\nmarked&nbsp;for&nbsp;review.</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n','Our goal is to challenge you and improve your critical thinking skills in order for you to understand the clinical reasoning behind the correct answer.  Let us help you pass your licensing exam with confidence and ease.','Active',1,'2018-07-31 05:30:36','2020-10-14 10:22:12'),(9,13,'NAPLEX-pharmacist.jpg','<h1><strong>Kickstart&nbsp;your&nbsp;career,&nbsp;our&nbsp;NAPLEX</strong></h1>\n\n<h1><strong>preparation&nbsp;primes&nbsp;you&nbsp;for&nbsp;success.</strong></h1>\n\n<h1>&nbsp;</h1>\n','Your Success is Our Passion','<p>NAPLEX&nbsp;stands&nbsp;for&nbsp;North&nbsp;American&nbsp;Pharmacist&nbsp;Licensure&nbsp;Examination.&nbsp;&nbsp;Our&nbsp;NAPLEX&nbsp;practice&nbsp;tests&nbsp;are&nbsp;based&nbsp;on&nbsp;the&nbsp;current&nbsp;exams,&nbsp;so&nbsp;you&nbsp;can&nbsp;rest&nbsp;assured&nbsp;that&nbsp;you<br />\nwill&nbsp;cover&nbsp;all&nbsp;the&nbsp;information&nbsp;you&nbsp;need&nbsp;in&nbsp;order&nbsp;to&nbsp;score&nbsp;high&nbsp;on&nbsp;your&nbsp;final&nbsp;exam.&nbsp;We&nbsp;offer&nbsp;over&nbsp;2,600&nbsp;questions,&nbsp;ensuring&nbsp;that&nbsp;we&nbsp;cover&nbsp;all&nbsp;the&nbsp;pertinent&nbsp;information.<br />\nOur&nbsp;team&nbsp;of&nbsp;experienced&nbsp;pharmacists&nbsp;collected&nbsp;and&nbsp;organized&nbsp;the&nbsp;information&nbsp;to&nbsp;make&nbsp;sure&nbsp;all&nbsp;major&nbsp;aspects&nbsp;of&nbsp;the&nbsp;therapeutic&nbsp;study&nbsp;are&nbsp;included.</p>\n','<p><strong>2600&nbsp;Practice&nbsp;Questions&nbsp;</strong><br />\n&rsaquo;&nbsp;&nbsp;&nbsp;Developed&nbsp;and&nbsp;curated&nbsp;by&nbsp;experienced&nbsp;educators</p>\n\n<p><strong>Performance&nbsp;Tracker&nbsp;</strong><br />\n&rsaquo;&nbsp;&nbsp;&nbsp;Easily&nbsp;view&nbsp;your&nbsp;progress&nbsp;at&nbsp;a&nbsp;glance&nbsp;and&nbsp;compare&nbsp;with<br />\nothers.</p>\n\n<p><strong>Test&nbsp;Mode&nbsp;</strong><br />\n&rsaquo;&nbsp;&nbsp;&nbsp;Customize&nbsp;your&nbsp;test&nbsp;taking&nbsp;experience.&nbsp;Select&nbsp;tutor&nbsp;or<br />\ntest&nbsp;mode&nbsp;to&nbsp;suit&nbsp;your&nbsp;preparation&nbsp;goals</p>\n\n<p><strong>Personalized&nbsp;Practice&nbsp;Exam&nbsp;</strong><br />\n&rsaquo;&nbsp;&nbsp;&nbsp;Focus&nbsp;on&nbsp;pain&nbsp;points.&nbsp;Generate&nbsp;practice&nbsp;questions&nbsp;based<br />\non&nbsp;difficulty&nbsp;level,&nbsp;subject&nbsp;area&nbsp;or&nbsp;questions&nbsp;previously<br />\nmarked&nbsp;for&nbsp;review.</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n','Use the practice exams to review your strengths and weaknesses and improve on them.  If you get an answer incorrect, we will thoroughly explain the concept to make sure you completely understand the rationale.  We offer many opportunities for you to work on the calculations needed in order for you to feel confident on your actual exam day.','Active',1,'2018-07-31 05:32:08','2020-10-14 10:22:42'),(10,14,'USLME-Doctor.jpg','<h1><strong>Take&nbsp;the&nbsp;USMLE&nbsp;tests&nbsp;in&nbsp;your&nbsp;stride&nbsp;with</strong></h1>\n\n<h1><strong>comprehensive&nbsp;preparation&nbsp;and&nbsp;guidance.</strong></h1>\n\n<h1>&nbsp;</h1>\n','Your Success is Our Passion','<p>USMLE&nbsp;(the&nbsp;United&nbsp;States&nbsp;Medical&nbsp;Licensing&nbsp;Examination)&nbsp;is&nbsp;a&nbsp;set&nbsp;of&nbsp;four&nbsp;exams&nbsp;taken&nbsp;over&nbsp;different&nbsp;times&nbsp;in&nbsp;your&nbsp;medical&nbsp;career&nbsp;that&nbsp;determine&nbsp;whether&nbsp;or&nbsp;not&nbsp;you&#39;re<br />\nready&nbsp;to&nbsp;practice&nbsp;medicine.&nbsp;The&nbsp;prep&nbsp;exam&nbsp;are&nbsp;put&nbsp;together&nbsp;and&nbsp;taught&nbsp;by&nbsp;board-certified&nbsp;medical&nbsp;professionals&nbsp;who&nbsp;know&nbsp;first-hand&nbsp;what&nbsp;you&nbsp;will&nbsp;need&nbsp;to&nbsp;know&nbsp;in<br />\norder&nbsp;to&nbsp;start&nbsp;your&nbsp;residency.&nbsp;The&nbsp;first&nbsp;exam&nbsp;is&nbsp;set&nbsp;up&nbsp;to&nbsp;assess&nbsp;your&nbsp;basic&nbsp;scientific&nbsp;knowledge&nbsp;and&nbsp;aptitude&nbsp;towards&nbsp;medicine.&nbsp;The&nbsp;second&nbsp;step&nbsp;of&nbsp;the&nbsp;USMLE&nbsp;exam<br />\nincludes&nbsp;a&nbsp;clinical&nbsp;skills&nbsp;portion.&nbsp;Step&nbsp;3&nbsp;of&nbsp;the&nbsp;exam&nbsp;process&nbsp;gives&nbsp;potential&nbsp;institutions&nbsp;a&nbsp;final&nbsp;assessment&nbsp;of&nbsp;a&nbsp;physician&#39;s&nbsp;ability&nbsp;to&nbsp;be&nbsp;independent,&nbsp;responsible,&nbsp;and<br />\ncapable&nbsp;of&nbsp;delivering&nbsp;general&nbsp;medical&nbsp;care.</p>\n','<p><strong>1400&nbsp;Practice&nbsp;Questions&nbsp;</strong><br />\n&rsaquo;&nbsp;&nbsp;&nbsp;Developed&nbsp;and&nbsp;curated&nbsp;by&nbsp;experienced&nbsp;educators</p>\n\n<p><strong>Performance&nbsp;Tracker&nbsp;</strong><br />\n&rsaquo;&nbsp;&nbsp;&nbsp;Easily&nbsp;view&nbsp;your&nbsp;progress&nbsp;at&nbsp;a&nbsp;glance&nbsp;and&nbsp;compare&nbsp;with<br />\nothers.</p>\n\n<p><strong>Test&nbsp;Mode&nbsp;</strong><br />\n&rsaquo;&nbsp;&nbsp;&nbsp;Customize&nbsp;your&nbsp;test&nbsp;taking&nbsp;experience.&nbsp;Select&nbsp;tutor&nbsp;or&nbsp;<br />\ntest&nbsp;mode&nbsp;to&nbsp;suit&nbsp;your&nbsp;preparation&nbsp;goals.</p>\n\n<p><strong>Personalized&nbsp;Practice&nbsp;Exam&nbsp;</strong><br />\n&rsaquo;&nbsp;&nbsp;&nbsp;Focus&nbsp;on&nbsp;pain&nbsp;points.&nbsp;Generate&nbsp;practice&nbsp;questions&nbsp;based<br />\non&nbsp;difficulty&nbsp;level,&nbsp;subject&nbsp;area&nbsp;or&nbsp;questions&nbsp;previously<br />\nmarked&nbsp;for&nbsp;review.</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n','The USMLE exams include over 1,600 expertly written questions.  These questions are developed to improve your step-by-step critical thinking process.  We provide in-depth explanations and excellent illustrations, charts, and images to ensure that you comprehend and understand the content.','Active',1,'2018-07-31 05:33:35','2020-10-14 10:16:39');
